import React from 'react';
import { XAxis } from 'recharts';

const XAxisWrapper = ({ dataKey, label, ticks }) => {
  return (
    <XAxis
      dataKey={dataKey}
      label={{ value: label.value, position: label.position, offset: label.offset || 0 }}
      ticks={ticks}
    />
  );
};

export default XAxisWrapper;
